import React from "react";

function ExpenseStatistic(props) {
  const month = props.isMonth.map((value) => {
    return value.date.slice(5, 7);
  });
  console.log(month);
  
  return (
    <div
      style={{
        display: "flex",
        margin: "15px",
        marginBottom: 5,
        backgroundColor: "#f7dbfa",
        width: "95%",
        height: 180,
        borderRadius: 15,
        alignItems: "center",
      }}
    >
      <div
        className={month.includes('01') ? "slideBar" : ""}
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Jan
        </b>
      </div>
      <div
        className={month.includes('02')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Feb
        </b>
      </div>
      <div
        className={month.includes('03')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Mar
        </b>
      </div>
      <div
        className={month.includes('04')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Apr
        </b>
      </div>
      <div
        className={month.includes('05')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          May
        </b>
      </div>
      <div
        className={month.includes('06')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Jun
        </b>
      </div>
      <div
        className={month.includes('07')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Jul
        </b>
      </div>
      <div
        className={month.includes('08')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Aug
        </b>
      </div>
      <div
        className={month.includes('09')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Sep
        </b>
      </div>
      <div
        className={month.includes('09')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Oct
        </b>
      </div>
      <div
        className={month.includes('10')
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Nov
        </b>
      </div>
      <div
        className={month.includes()
            ? "slideBar"
            : ""
        }
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Dec
        </b>
      </div>
    </div>
  );
}

export default ExpenseStatistic;
